pragma solidity ^0.4.18;

import "./ERC20.sol";
/**
 * The WordCup contract does this and that...
 */
contract WordCup is WordCupToken {
    address public ceoAddress;
    event PartIn(address indexed from, uint256 _tokenId);
    event Create(address indexed from, uint256 _tokenId);

    struct Token {
        address seller;
        uint status;
        address[] redParticipant;
        address[] blueParticipant;
        address[] equalParticipant;
        bytes32 red;
        bytes32 blue;
        uint  winner;
        uint256 prizePool;
    }

    Token[] tokens;

    mapping(address => mapping(uint256 => mapping(uint => uint256))) partTokenAccount;
    mapping(address => uint256[]) partToken;
    mapping (address => uint256[]) ownerToken;

    function _create(address _seller, bytes32 _red, bytes32 _blue) internal returns (uint256 tokenId){
        Token memory token = Token({
            seller: _seller,
            red: _red,
            blue: _blue,
            status: 0,
            redParticipant: new address[](0),
            blueParticipant: new address[](0),
            equalParticipant: new address[](0),
            winner: 3,
            prizePool: 0
        });

        tokenId = tokens.push(token) - 1;
        ownerToken[_seller].push(tokenId);
    }

    constructor() public {
        ceoAddress = msg.sender;
    }

    function createGame(bytes32 _red, bytes32 _blue) external returns(uint256 tokenId){
        tokenId = _create(msg.sender, _red, _blue);
        emit Create(msg.sender, tokenId);
    }

   function add_parter(address _parter, uint256 _tokenId, uint256 _price, uint _side) internal {
        if (_side == 0){
            tokens[_tokenId].redParticipant.push(_parter);
        }else if (_side == 1){
            tokens[_tokenId].equalParticipant.push(_parter);
        }else if (_side == 2){
            tokens[_tokenId].blueParticipant.push(_parter);
        }

        tokens[_tokenId].prizePool += _price;
        partTokenAccount[_parter][_tokenId][_side] = _price;
        partToken[_parter].push(_tokenId);
   }

    function partIn(uint256 _tokenId, uint256 _price, uint _side) external {
        Token memory token = tokens[_tokenId];
        require (_side == 0 || _side == 1 || _side == 2);
        require (token.status == 0);
        require (_price > uint256(0));
        require (balanceOf(msg.sender) >= _price);
        transfer(address(this), _price);
        add_parter(msg.sender, _tokenId, _price, _side);
        emit PartIn(msg.sender, _tokenId);
    }

    function getContractAddress() external view returns (address) {
        return address(this);
    }

    function getContractBalance() external view returns (uint256) {
        return balanceOf(address(this));
    }

    function getCeoAddress () external view returns (address) {
        return ceoAddress;
    }

    function getGame (uint256 _tokenId) external view returns (
        address _seller,
        uint _status,
        uint256 redLength,
        uint256 blueLength,
        uint256 equalLength,
        uint256 all,
        bytes32 _red,
        bytes32 _blue,
        uint _winner,
        uint256 _prizePool) {
        Token memory token = tokens[_tokenId];
        _seller = token.seller;
        redLength = token.redParticipant.length;
        blueLength = token.blueParticipant.length;
        equalLength = token.equalParticipant.length;
        _red = token.red;
        _blue = token.blue;
        _winner = token.winner;
        _prizePool = token.prizePool;
        all = redLength + blueLength + equalLength;
        _status = token.status;
    }

    function getPartIn () external view returns (uint256[]) {
        uint256[] memory result = new uint256[](partToken[msg.sender].length);
        for (uint256 i; i < partToken[msg.sender].length; i++) {
            result[i] = partToken[msg.sender][i];
        }
        return result;
    }

    function getCreate () external view returns (uint256[]) {
        uint256[] memory result = new uint256[](ownerToken[msg.sender].length);
        for (uint256 i; i < ownerToken[msg.sender].length; i++) {
            result[i] = ownerToken[msg.sender][i];
        }
        return result;
    }


    function _return (uint256 _tokenId) internal returns(bool res)  {
        for (uint256 i; i < tokens[_tokenId].redParticipant.length; i++){
            if (partTokenAccount[tokens[_tokenId].redParticipant[i]][_tokenId][0] > 0){
                _return(tokens[_tokenId].redParticipant[i], partTokenAccount[tokens[_tokenId].redParticipant[i]][_tokenId][0]);
            }

        }
        for (uint256 j; j < tokens[_tokenId].blueParticipant.length; j++){
            if (partTokenAccount[tokens[_tokenId].blueParticipant[j]][_tokenId][2] > 0){
                _return(tokens[_tokenId].blueParticipant[j], partTokenAccount[tokens[_tokenId].blueParticipant[j]][_tokenId][2]);
            }

        }
        for (uint256 h; h < tokens[_tokenId].equalParticipant.length; h++){
            if (partTokenAccount[tokens[_tokenId].equalParticipant[h]][_tokenId][1] > 0){
                _return(tokens[_tokenId].equalParticipant[h], partTokenAccount[tokens[_tokenId].equalParticipant[h]][_tokenId][1]);
            }

        }
        tokens[_tokenId].status = 2;
        return true;
    }

    function _profit (address[] profitAddress, uint256 profitPrice) internal returns(bool res)  {
        for (uint256 i; i < profitAddress.length; i++){
            _return(profitAddress[i], profitPrice);
        }
        return true;
    }


    function _getPrice(uint256 numerator, uint256 denominator) internal view returns(uint256 _price)  {     
        require (denominator > 0);     
        uint256 remainder =  (numerator * 10 ** decimals) % denominator;
        uint256 divisor = numerator - remainder;
        _price = divisor / denominator;

    }


    function _open(uint256 _tokenId) internal  returns(bool res)  {
        if ((tokens[_tokenId].redParticipant.length > 0 && tokens[_tokenId].blueParticipant.length > 0) ||
         (tokens[_tokenId].redParticipant.length > 0 && tokens[_tokenId].equalParticipant.length > 0) ||
          (tokens[_tokenId].blueParticipant.length > 0 && tokens[_tokenId].equalParticipant.length > 0)){
                uint256 sellerProfit = tokens[_tokenId].prizePool * 2 / 25;
                uint256 participantProfit = tokens[_tokenId].prizePool * 9 / 10;
                uint256 _denominator;
                uint256 _price;

                if (tokens[_tokenId].winner == 0){
                    _denominator = tokens[_tokenId].redParticipant.length;
                    if (_denominator == 0){
                        _return(_tokenId);
                        return true;
                    }
                   _price = _getPrice(participantProfit, _denominator);
                    _profit(tokens[_tokenId].redParticipant, _price);
                }else if(tokens[_tokenId].winner == 1){
                    _denominator = tokens[_tokenId].equalParticipant.length;
                    if (_denominator == 0){
                        _return(_tokenId);
                        return true;
                    }
                    _price = _getPrice(participantProfit, _denominator);
                    _profit(tokens[_tokenId].equalParticipant, _price);
                }else if(tokens[_tokenId].winner == 2){
                    _denominator = tokens[_tokenId].blueParticipant.length;
                    if (_denominator == 0){
                        _return(_tokenId);
                        return true;
                    }
                    _price = _getPrice(participantProfit, _denominator);
                    _profit(tokens[_tokenId].blueParticipant, _price);
                }
                _return(tokens[_tokenId].seller, sellerProfit);
                tokens[_tokenId].status = 1;
                return true;

            }else{
                _return(_tokenId);
            }
        return true;
    }

    function openGame (uint256 _tokenId, uint _winner) external returns(bool) {

        require (tokens[_tokenId].status == 0);
        require (msg.sender == tokens[_tokenId].seller, "sender address error");
        require (_winner == 0 || _winner == 1 || _winner == 2);

        tokens[_tokenId].winner = _winner;
        return _open(_tokenId);
    }

    function () external payable {}
}
